import re

def validate_query_parameter(query_input: str) -> bool:

    if len(query_input) > 1024:
        return False

    # Check for valid characters
    valid_chars = re.compile(r'[a-zA-Z0-9=&%.]')
    if not valid_chars.match(query_input):
        return False

    # Split the input into individual parameters
    params = query_input.split('&')
    for param in params:
        key, value = param.split('=')
        if not key or not value:
            return False

    return True

